//// SPDX-License-Identifier: MIT
pragma solidity >=0.5.1 <0.7.0;


contract Trades {
    uint256 public count;
    uint256 public tradeCount;
    string[] public tradeId;

    mapping(string => string) tradeList;

    struct Curator {
        address addr;
        int256 validated;
    }

    Curator[] public curators;
    Curator[] tempC;

    mapping(string => Curator[]) public approval;

    constructor(address[] memory curatorsList) public {
        for (uint256 i = 0; i < curatorsList.length; i++) {
            Curator memory t;
            t.addr = curatorsList[i];
            t.validated = 0;
            curators.push(t);
            count ++;
        }
    }

    function setApprovals(string memory _id) public {
        uint256 cnt = curators.length;
        Curator[] memory c = new Curator[](cnt);

        for (uint256 i = 0; i < curators.length; i++) {
            Curator memory t;
            t.addr = curators[i].addr;
            t.validated = 0;
            c[i] = t;
            tempC.push(t);
        }

        approval[_id] = tempC;
    }

    function approve(string memory _id) public {
        uint x = 0;
        for(uint i=0; i<curators.length; i++){
            if(approval[_id][i].addr == msg.sender){
                x = i;
            }
        }        
        approval[_id][x].validated = 1;
    }

    function reject(string memory _id) public {
        uint x = 0;
        for(uint i=0; i<curators.length; i++){
            if(approval[_id][i].addr == msg.sender){
                x = i;
            }
        }        
        approval[_id][x].validated = 2;
    }

    function allApproved(string memory _id) public view returns(bool res){
        uint counter = 0;

        for(uint i=0; i<curators.length; i++){
            if(approval[_id][i].validated == 1){
                counter ++;
            }
        }

        if(counter > (5*curators.length)/10){
            return true;
        }else{
            return false;
        }

    }    

    function getStatus(string memory _id, uint n) public view returns(int256 stat){
    	return approval[_id][n].validated;
    }

    function setTrade(string memory _id, string memory _tHash) public {

        tradeId.push(_id);
        tradeList[_id] = _tHash;
        tradeCount++;
        setApprovals(_id);
    } 

    function getTrade(string memory _id) public view returns(string memory _name){ 

        return (tradeList[_id]);
    } 
}
